import React, { Component } from "react";


import  ElsowinyPortfolioListContent from "./Portfolio/ElsowinyPortfolio";

const list = ElsowinyPortfolioListContent.ElsowinyPortfolioListContent
//portfolio aka my laboratory 
/*
const ElsowinyPortfolioListContent = [
    {
        image: 'ios',
        category: 'IOS',
        title: 'Dice application'
    },
    {
        image: 'python',
        category: 'Python',
        title: 'Python machine learning'
    },
    {
        image: 'java',
        category: 'Java',
        title: 'Java Spring Rest Crud Database'
    },
    {
        image: 'webdev',
        category: 'Web Development',
        title: 'React Personal Website'
    },
    {
        image: 'java',
        category: 'Java',
        title: 'Java Finance & Web Scrape'
    },
    {
        image: 'webdev',
        category: 'Web Development',
        title: 'Angular Full Commerce Website'
    }
]

*/
class PortfolioList extends Component{
    render(){
        const {column , styevariation } = this.props;
        const list = list.slice(0 , this.props.item);
        return(
            <React.Fragment> 
                {list.map((value , index) => (
                    <div className={`${column}`} key={index}>
                        <div className={`portfolio ${styevariation}`}>
                            <div className="thumbnail-inner">
                                <div className={`thumbnail ${value.image}`}></div>
                                <div className={`bg-blr-image ${value.image}`}></div>
                            </div>
                            <div className="content">
                                <div className="inner">
                                    <p>{value.category}</p>
                                    <h4><a href="/portfolio-details">{value.title}</a></h4>
                                    <div className="portfolio-button">
                                        <a className="rn-btn" href="/portfolio-details">View Details</a>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
               
            </React.Fragment>
        )
    }
}
export default PortfolioList;
